import React, { useEffect } from 'react'

const Covid = () => {

    const getCovidData = async () =>{
        try {
            const res  = await fetch('https://api.covid19api.com/all')
            res.json();
        } catch (error) {
            console.log(error)
        }
    }
    useEffect = (()=>{
        getCovidData();
    }, []);

  return (
    <>
      <h1> LIVE</h1>
      <h2>COVID-19 CORONAVIRUS TRACKER</h2>
    </>
  )
}

export default Covid
